Sample containers encapsulate single shares of the DataSquare . Sample containers are protobuf formatted using the following proto3 schema: syntax = "proto3"; message Sample { bytes sample_id = 1; bytes sample_share = 2; Proof sample_proof = 3; ProofType proof_type = 4;
} enum ProofType { RowProofType = 0; ColProofType = 1;
} The fields with validity rules that form Sample containers are: SampleID : A SampleID of the Sample container. It MUST follow SampleID formatting and field validity rules. SampleShare : A variable size array representing the share contained in the sample. Each share MUST follow share formatting and validity rules. Proof : A protobuf formated NMT proof of share inclusion. It MUST follow NMT proof verification and be verified against the respective root from Row or Column axis in DAH . The axis is defined by ProofType field. ProofType : An enum defining which root the Proof is coming from. It MUST be either RowProofType or ColumnProofType.
